import "./App.css";

// Example of a data array that
// you might receive from an API
const data = [{ b: "", i: 19, n: "Male", g: 19, o: 19 }];

function App() {
  return (
    <div className="App">
      <table>
        <tr>
          <th>B</th>
          <th>I</th>
          <th>N</th>
          <th>G</th>
          <th>O</th>
        </tr>
        {data.map((val, key) => {
          return (
            <tr key={key}>
              <td>{val.name}</td>
              <td>{val.age}</td>
              <td>{val.gender}</td>
              <td>{val.name}</td>
              <td>{val.age}</td>
            </tr>
          );
        })}
      </table>
    </div>
  );
}

export default App;
